import React from 'react';

const Resume = () => {
    return (
        <div className="container resume">
            <div className="row">
                <div className="col-lg-6 resume_card">
                    <h4 className="resume_card_heading"></h4>
                </div>
            </div>
        </div>
    );
};

export default Resume;
